import React from 'react'

const Modal = props => {
    if (!props.show){
        return null
    }
    return(
        <div className='modal'>
            <div className='modal-content'>
                <h4>Modal Title</h4>
            </div>
            <div className='modal-body'>
                This is modal body
            </div>
            <div className='modal-footer'>
                <button className='exit' onClick={props.onClose}>Close</button>
            </div>
        </div>
    )
}

export default Modal
